import React from 'react';
import { Link }  from 'react-router-dom';
import 'animate.css';

let vid = document.getElementById("myVideo");
function playVid() {
  vid.play();
	vid.autoplay = true;
	document.getElementById("myVideo").load();

}

function myFunction() {
  document.getElementById("myVideo").load();
}


export default () => (
	<div className='landing'>
		<div className='info'>


		<iframe   src="https://www.learningcontainer.com/bfd_download/sample-mp4-file/" onloadedmetadata="this.autoplay = true" allow="autoplay" id="audio" type="video/mp4">
			<source  width="100rem" height="100%"  src="https://www.learningcontainer.com/bfd_download/sample-mp4-file/" allow="autoplay" id="audio" type="video/mp4" onloadedmetadata="this.autoplay = true" allow="autoplay" ></source>
			<source   src="https://www.learningcontainer.com/bfd_download/sample-mp4-file/" type="video/mp4" />
		</iframe>


		<iframe  src="IG.mp4"  onloadedmetadata="this.autoplay = true" allow="autoplay" id="audio" type="video/mp4">
			<video controls>Your browser does not support the &lt;video&gt; tag.
			  <source src="IG.mp4" allow="autoplay" id="audio" type="video/mp4" onloadedmetadata="this.autoplay = true" allow="autoplay"/>
			</video>
		</iframe>


<div >
<video  id="myVideo" >
<iframe   src="bunny.ogg" type="video/ogg">
 <source src="drake.mp4" type="video/mp4" />
	 <source src="http://techslides.com/demos/sample-videos/small.ogv" type="video/ogg"></source>
<source  width="100rem" height="100%"  src="bunny.ogg" type="video/ogg" allow="autoplay" id="audio" onloadedmetadata="this.autoplay = true" allow="autoplay" >
				</source>
</iframe>

</video>
</div>


		<h2>
		New Wave
		</h2>
		<h3>Property Group</h3>
			<p class="animated fadeInUp">We take your dream home and make it real.</p>
			<Link to='/contactpage'>
			<button className="button1">BOOK YOUR CONSULTATION</button>
			</Link>

		</div>
	</div>
);
